import React from "react";

import styles from "./HeaderSearchMenu.module.css";

const HeaderSearchMenu = (props) => {
  return (
    <div className={styles.menu}>
      <div className={styles["menu-where"]}>
        <i className="fa fa-bed"></i>
        <input placeholder="Where are you going?"></input>
      </div>
      <div className={styles["menu-when"]}>
        <i className="fa fa-bed"></i>
      </div>
      <div></div>
      <button>Search</button>
    </div>
  );
};

export default HeaderSearchMenu;
